import React from "react";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";

const MapComponent = () => {
  return (
    <MapContainer center={[55.751244, 37.618423]} zoom={10} style={{ width: "100%", height: "400px" }}>
      <TileLayer
        url="https://tilessputnik.ru/{z}/{x}/{y}.png?apikey=YOUR_API_KEY"
        attribution='&copy; <a href="https://2gis.ru">2GIS</a> contributors'
      />
      <Marker position={[55.751244, 37.618423]}>
        <Popup>Moscow</Popup>
      </Marker>
    </MapContainer>
  );
};

export default MapComponent;
